import React from "react";

function Table_dar(prop){
    return(
    <div className="border border-primary bg-primary d-flex justify-content-center align-items-center rounded"> 
       <div className="Circle-player rounded-circle">
          <div className="rounded-circle bg-primary border Boy Boy1"> </div>
          <div className="rounded-circle bg-primary border Boy Boy2"> </div>
          <div className="rounded-circle bg-primary border Boy Boy3"> </div>
          <div className="rounded-circle bg-primary border Boy Boy4"> </div>
       </div>
    </div>
    )
}
export default Table_dar
